var imageTemplate = 'data:image/jpeg;base64,'


// global vars
var {
    Alert,
    AppRegistry,
    StyleSheet,
    View,
    Text,
    TextInput,
    Image,
    ScrollView,
    TouchableHighlight,
} = React;

class EditOffer extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            jobTitle: '',
            jobDescription: '',
            deadline: '',
            payment: '',
            image: imageTemplate,
            loaded: false
        };
        this._pickImage = this._pickImage.bind(this);
    }

    componentDidMount(props) {
      this._loadOffer(this.props.offerId);
    }

    componentWillReceiveProps(nextProps) {
      this._getOffers(nextProps.offerId);
    }

    _loadOffer(offerId){
      ClientApi().getOffer(offerId).then(
      (offer) => {
        console.log('Successfully loaded offer: ', offer);
        this.setState({
          jobTitle: offer.title,
          jobDescription: offer.description,
          deadline: offer.deadline,
          payment: offer.payment.value,
          image: offer.image,
          loaded: true
        });
      },(error) => {
        debugger
        console.error("Error:", error.error_description);
        Alert.alert(
          'Error',
          error.error_description);
      });
    }

    render() {
        return (this.state.loaded ? <ScrollView style={styles.scrollView}
          contentContainerStyle={styles.container} scrollEnabled={false}>
        <View style={styles.row}>
          <View style={styles.col}>
            <NavBarStandard title="Edit offer" onPressLeft={() => this.props.navigator.pop()}/>
          </View>
        </View>
        <View style={styles.card}>
          <TouchableHighlight onPress={this._pickImage}>
            <Image style={styles.thumbnail} source={{uri:this.state.image}}/>
          </TouchableHighlight>
          <MKTextField
            style={styles.textInputTitle}
            placeholder="Job Title"
            value={this.state.jobTitle}
            onChangeText={(jobTitle) => this.setState({jobTitle})}/>
          <View style={styles.submenu}>
            <Text style={styles.text_subtitle}>Job description</Text>
            </View>
              <MKTextField
                style={styles.textFieldTitle}
                placeholder="Enter a description for the job"
                multiline={true}
                value={this.state.jobDescription}
                onChangeText={(jobDescription) => this.setState({jobDescription})}/>
            <View style={styles.text_container}>
              <Text style={styles.text_subtitle}>Deadline: </Text>
              <MKTextField
                style={styles.textRightField}
                placeholder="MM.DD.YYYY"
                value={Moment(this.state.deadline).format('L')}
                onChangeText={(deadline) => this.setState({deadline})}/>
          </View>
          <View style={styles.text_container }>
            <Text style={styles.text_subtitle}>Payment: </Text>
            <MKTextField
              style={styles.textRightField}
              placeholder="e.g. 20$ per hour"
              value={String(this.state.payment)}
              onChangeText={(payment) => this.setState({payment})}/>
          </View>
        </View>
        <View style={styles.row}>
          <View style={styles.col}>
            <LoginButton onPress={() => this._updateOffer()} text="Update offer"/>
          </View>
        </View>
      </ScrollView> : <View></View>


        );


    }

    _pickImage() {
      var options = {
          title: 'Select Avatar', // specify null or empty string to remove the title
          cancelButtonTitle: 'Cancel',
          takePhotoButtonTitle: 'Take Photo...', // specify null or empty string to remove this button
          chooseFromLibraryButtonTitle: 'Choose from Library...', // specify null or empty string to remove this button
          cameraType: 'back', // 'front' or 'back'
          mediaType: 'photo', // 'photo' or 'video'
          videoQuality: 'high', // 'low', 'medium', or 'high'
          durationLimit: 10, // video recording max time in seconds
          maxWidth: 500, // photos only
          maxHeight: 500, // photos only
          aspectX: 2, // android only - aspectX:aspectY, the cropping image's ratio of width to height
          aspectY: 1, // android only - aspectX:aspectY, the cropping image's ratio of width to height
          quality: 0.5, // 0 to 1, photos only
          angle: 0, // android only, photos only
          allowsEditing: true, // Built in functionality to resize/reposition the image after selection
          noData: false, // photos only - disables the base64 `data` field from being generated (greatly improves performance on large photos)
          storageOptions: { // if this key is provided, the image will get saved in the documents directory on ios, and the pictures directory on android (rather than a temporary directory)
              skipBackup: true, // ios only - image will NOT be backed up to icloud
              path: 'images' // ios only - will save image at /Documents/images rather than the root
          }
      };

        ImagePickerManager.showImagePicker(options, (response) => {
            console.log('Response = ', response);

            if (response.didCancel) {
                console.log('User cancelled image picker');
            } else if (response.error) {
                console.log('ImagePickerManager Error: ', response.error);
            } else if (response.customButton) {
                console.log('User tapped custom button: ', response.customButton);
            } else {
                // You can display the image using either data:
                const source = {uri: 'data:image/jpeg;base64,' + response.data, isStatic: true};

                // uri (on iOS)
                //const source = {uri: response.uri.replace('file://', ''), isStatic: true};
                // uri (on android)
                // const source = {uri: response.uri, isStatic: true};

                this.setState({
                    image: source.uri
                });
            }
        });
    }

    _updateOffer() {
      var that = this;
      // Vars for updating offer
      var title = this.state.jobTitle;
      var description = this.state.jobDescription;
      var image = this.state.image;

      //var location = {
      //  'lat': this.state.lat || 48.346371,
      //  'lon': this.state.lon || 14.510034
      //};

      var loc = LocationManager.getLastKnownLocation();

      var location = {
        'lat': loc.coords.latitude,
        'lon': loc.coords.longitude
      };

      var payment = {
        'type': this.state.paymentType || "MONEY",
        'value': this.state.payment || "20$ per Hour"
      };
      // TODO convert inserted date
      // See Moment.js docs beware of the location settings
      var deadline = Moment().toDate();

      var offer ={
        'title': title,
        'description': description,
        'image': image,
        'location': location,
        'payment': payment,
        'deadline': deadline,
      }
      console.log("Send offer to Api: ", offer);

      ClientApi().updateOffer(this.props.offerId, offer).then(
        ()=> {
          console.log("Offer updated succesfully!");
          that.props.navigator.pop();

        },(error) => {
          console.error("Error:", error);
          Alert.alert(
            'Error',
            error.message);
      });

      console.log('New offer created');



    }

}

